/**
 * Get the image source for a given filename or URL
 * @param filenameOrUrl The image filename or URL
 * @returns The image source
 */
export function getQuestionImage(filenameOrUrl: string | null) {
  if (!filenameOrUrl) return null;

  // Handle URLs from enem.dev
  let baseFilename: string;
  if (filenameOrUrl.includes('enem.dev')) {
    // Extract just the filename from the URL
    const urlParts = filenameOrUrl.split('/');
    baseFilename = urlParts[urlParts.length - 1];
    console.log(`Processing enem.dev URL: ${filenameOrUrl} -> ${baseFilename}`);
  } else {
    // Extract just the filename without path
    baseFilename = filenameOrUrl.split('/').pop() || '';
  }

  if (!baseFilename) return null;

  // First try exact match
  if (imageMapping[baseFilename]) {
    return imageMapping[baseFilename];
  }

  // If not found, try case-insensitive match
  const lowerFilename = baseFilename.toLowerCase();
  const keys = Object.keys(imageMapping);
  for (const key of keys) {
    if (key.toLowerCase() === lowerFilename) {
      return imageMapping[key];
    }
  }

  // If still not found, try to match without extension
  const filenameWithoutExt = lowerFilename.split('.')[0];
  for (const key of keys) {
    const keyWithoutExt = key.toLowerCase().split('.')[0];
    if (keyWithoutExt === filenameWithoutExt) {
      console.log(`Found image with different extension: ${key} for ${baseFilename}`);
      return imageMapping[key];
    }
  }

  // Log the missing image for debugging
  console.warn(`Image not found in mapping: ${baseFilename}`);

  // Not found
  return null;
}

export default imageMapping;
